import React from "react";

export default function CloudCard(){
    return <div className='mt-[300px] m-auto w-[900px] relative'>
        <img className="w-[400px] m-auto" src={require('../assets/images/mountains-card.jpg')} alt="" />
        <img className="absolute inset-0 w-[550px] left-2 -top-" src={require('../assets/images/clouds1.png')} alt="" />
    </div>
}
